import React from 'react';
import {BarController, Chart, defaults} from 'chart.js';
import { Line } from 'react-chartjs-2';

const state = {
  labels: ['2016', '2017', '2018',
           '2019'],
  datasets: [
    {
      label: 'Numbers of airstrikes',
      fill: false,
      lineTension: 0.5,
      backgroundColor: 'rgba(75,192,192,1)',
      borderColor: 'rgba(0,0,0,1)',
      borderWidth: 2,
      data: [1000, 2, 4, 6, 8]
    }, {
      label: 'Numbers of airstrikes',
      fill: false,
      lineTension: 0.5,
      backgroundColor: 'rgba(75,192,192,1)',
      borderColor: 'rgba(0,0,0,1)',
      borderWidth: 2,
      data: [100, 6, 4, 10, 8]
    },
  ]
}

export default class Patterns extends React.Component {
  render() {
    return (
      <div>
        <Line
          data={state}
          options={{
            title:{
              display:true,
              text:'Trends and patterns',
              fontSize:20
            },
            legend:{
              display:true,
              position:'right'
            }
          }}
        />
      </div>
    );
  }
}
